  [],\n\t\"revision_timestamp\": \"2016-07-27T22:23:59.439492\",\n\t\"name\": \"mackay-island-national-wildlife-refuge-currituck-national-wildlife-refuge-annual-narrati-1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Mackay
  Island and Currituck National Wildlife Refuges outlines Refuge accomplishments during
  the 1991 calendar year.  The report begins with a summary of the year's highlights
  and weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses the management plan. Refuge administration is outlined;
  information about personnel, manpower programs, volunteer programs, funding, and
  safety is given. Habitat management is also covered; subjects include wetlands,
  forests, croplands, fire management, and pest control. The wildlife section of the
  report discusses endangered and threatened species, waterfowl, marsh and waterbirds,
  shorebirds, raptors, game mammals, fisheries resources, animal control, and marking
  and banding. The public uses of the Refuge described in this report include outdoor
  classrooms, interpretive programs, hunting, fishing, trapping, wildlife observation,
  outdoor recreation, and law enforcement. The equipment and facilities section of
  the report provides information about new construction, rehabilitation, equipment
  replacement, communication systems, computer systems, and energy conservation. Cooperative
  programs and economic uses of the Refuge are provided at the end. Field guides are
  attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
